import React from "react";
import {  useNavigate } from "react-router-dom"; 
import './css/signup.css';
const Signup=()=>{
  const navigate=useNavigate();
  const fun=()=>{
    navigate('/')
  }
  const again=()=>{
    navigate('/login');
  }
 
  return(
    <div className="for">
   <div className="sign">
    <div className="logostuffs"></div>
    <div className="signup">
    <div className="all">
    <h1>Sign Up</h1>
   <input type="email" placeholder="Email"/>
    <input type="password" placeholder="password"/>
    <input type="password" placeholder="Confirm Password"/>
    </div>
    <div className="extra">
    <button onClick={fun} style={{ textDecoration: 'none' }}>Submit</button>
    </div>
    <div className="e">
    <p>forgot password?</p>
    <p>Already have an account? <span onClick={again} style={{ cursor: 'pointer', color: 'blue' }}>Login</span> here</p>
    </div>
    </div>
    </div>
    </div>
  );

}
export default Signup;
